import React, { useEffect, useState } from 'react';
import axios from 'axios'
import  Cookie  from "universal-cookie";
const AccountPage = () => {
    const [account , setAccount] = useState([])
    const cookie = new Cookie()
    const token = cookie.get('bearer')
    useEffect(()=>{
        axios.get('http://127.0.0.1:8000/api/showmyaccunt',{
            headers:{
                Authorization : 'Bearer ' + token
            }
        }).then((res)=>setAccount(res.data.data))
         //eslint-disable-next-line react-hooks/exhaustive-deps
    },[])
    
    let tr = account.map((item,index)=>{
        return<tr key={index}>
              <td>{item.accountNumber}</td>
              {/* <td>{account.accmonies[0].balance}</td>
              <td>{account.accmonies[1].balance}</td>
              <td>{account.accmonies[2].balance}</td> */}
              <td>{account.openingDate}</td>
              {/* You can add more rows here for additional attributes */}
        </tr>
       })
  return (
    <div>
      <h1>My Account Page</h1>
      {account && (
        <table>
          <thead>
            <tr>
              <th>Attribute</th>
              <th>Value</th>
              {/* <th>Euro Balance</th>
              <th>Turkish Lira Balance</th>
              <th>US Dollar Balance</th> */}
            </tr>
          </thead>
          <tbody>

           {tr}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default AccountPage;
